import Navbar from './Navbar';
import { LanguageSource } from './LanguageSource';
// import { Routes, Route, useLocation, Link } from "react-router-dom";
import './jmv.css';

function Jmv() {
  return (
    <>
      <LanguageSource>
        <Home />
        <Navbar />
      </LanguageSource>
    </>
    );
}

export default Jmv;
